import React from "react";

export default function ResumeEducation() {
  return (
    <div className="resume-education">
      <h3>Education</h3>
      <p className="education-school">Strathmore University</p>
      <p className="work-role">Bs. Computer Science</p>
      <span>From: </span>
      <span>14/09/2014</span> <span>To: </span>
      <span>20/05/2019</span>
      <hr />
    </div>
  );
}
